<section class="mbr-section content4 cid-rANLdtR7KK" id="content4-a">

    

    <div class="container">
        <div class="media-container-row">
            <div class="title col-12 col-md-8">
                <h2 class="align-center pb-3 mbr-fonts-style display-2">
                    Besseggen</h2>
                <h3 class="mbr-section-subtitle align-center mbr-light mbr-fonts-style display-5">
                    En ganske krevende tur på 14. 1 km som tok oss 8 timer med pauser. Vi hadde stille flott vær da vi gikk turen fredag 17. juli i 2015. Turen startet med overnatting på Gjendesheim fra torsdag til fredag, så med båt over til Memurubu fredag morgen. Derfra gikk turen oppover fjellet. Vi hadde to lengre pauser og noen mindre drikke- og "se på utsikten"- pauser underveis. <br><br>En slik tur er først og fremst en utfordring for knærne. Derfor lønner det seg å spare på de så mye som mulig på oppvei. For det er på nedturen på andre siden ned mot Gjendesheim det virkelig røyner på. Knærne spares best ved å gå utenom alle trappetrinn, og heller gå i det skrå terrenget på siden.<br><br>Etter turen ned fra fjellet var det fint å komme til tre retters herlig middag på Gjendesheim. En ufoglemmelig tur.<br><br><a href="https://ut.no/tur/1110295/besseggen-memurubu-gjendesheim/kart" target="_blank" style="font-style: italic;">Stort kart på ut.no</a>&nbsp;|&nbsp;<a href="https://ut.no/api/trip/1110295/gpx">Gpxfil fra ut.no</a></h3>
                
            </div>
        </div>
    </div>
</section>

